import { useState,useEffect } from "react";

export function Api (userId) {
    const [data,setData] = useState([])

    useEffect (() => {
        fetch("http://localhost:3000/user/"+ userId + "/performance")
            .then((res) => res.json())
            .then((temp) => {
                setData(temp)
            })
            .catch((err) => {
                console.log(err.message)
            })
    },[])
    return data
}

export default Api
